import './footer.styles.scss';
import { FaBeer } from 'react-icons/fa';


const FooterPage = () => {


  return (
    <div className='footer'>
      <span className='card'>
        <div className='text'> プライバシーポリシー </div>
        <div className='text'> 特定商取引法に基づく表記 </div>
      </span>
      <span className='card'>
      <FaBeer />
      </span>
      <span className='card'>

      </span>
    </div>
  );
}

export default FooterPage;
